import React from 'react';
import { useParams } from 'react-router-dom';

// Sample pump data (you can import this from your data file)
const pumps = [
  { id: 'v4', name: 'Rust free V4- Stainless Steel Pumps', image: 'path/to/image', price: 'MRP ₹16,975.00' },
  // Add other pumps here...
];

const PumpDetail = () => {
  const { id } = useParams();
  const pump = pumps.find(p => p.id === id);

  if (!pump) {
    return <div>Pump not found</div>;
  }

  return (
    <div>
      <h1>{pump.name}</h1>
      <img src={pump.image} alt={pump.name} />
      <p>{pump.price}</p>
      {/* Add more details as needed */}
    </div>
  );
};

export default PumpDetail;
